import React, { Component } from "react";
import { Link } from "react-router-dom";

import axios from "axios";

import CarTable from "./CarTable";

import Header from "./Header";
import Footer from "./Footer";
//import Product from "./Product";

import {
  // ACCESS_LEVEL_GUEST,
  ACCESS_LEVEL_ADMIN,
  SERVER_HOST,
} from "../config/global_constants";

export default class DisplayAllCars extends Component {
  constructor(props) {
    super(props);

    this.state = {
      cars: [],
      appTitle: "Customers",
      customersCount: 0,
      users: [],
      customers: [
        {
          id: 1,
          name: "Scott",
          phone: "234234",
          address: { city: "London" },
          photo: "https://picsum.photos/id/1010/60",
        },
        {
          id: 2,
          name: "Jones",
          phone: "567567",
          address: { city: "Praga" },
          photo: "https://picsum.photos/id/1011/60",
        },
        {
          id: 3,
          name: "Smith",
          phone: null,
          address: { city: "Sofia" },
          photo: "https://picsum.photos/id/1012/60",
        },
        {
          id: 4,
          name: "John",
          phone: "3453466",
          address: { city: "Plovdiv" },
          photo: "https://picsum.photos/id/1013/60",
        },
      ],
    };
  }

  componentDidMount() {
    axios
      .get(`${SERVER_HOST}/cars`)
      .then((res) => {
        this.setState({ cars: res.data });
      })
      .catch((err) => {
        // do nothing
      });
    axios
      .get(`${SERVER_HOST}/users`)
      .then((res) => {
        this.setState({ users: res.data });
        console.log(this.res.data);
      })
      .catch((err) => {
        // do nothing
      });
  }
  //Executes when user clicks on Refresh button
  onRefreshClick = () => {
    this.setState({
      customersCount: 7,
    });
  };
  getPhoneToRender = (phone) => {
    if (phone) {
      return phone;
    } else {
      return <div className="bg-warning p-2 text-center">No phone</div>;
    }
  };

  getCustomerRow = () => {
    return this.state.customers.map((cust) => {
      return (
        <tr key={cust.id}>
          <td>{cust.id}</td>
          <td>
            <img src={cust.photo} alt="Customer" />
          </td>
          <td style={{backgroundColor:(cust.name.st)}}>{cust.name}</td>
          <td>{this.getPhoneToRender(cust.phone)}</td>
          <td>{cust.address.city}</td>
        </tr>
      );
    });
  };
  render() {
    return (
      <div className="outer__container">
        <Header />

        <h4>{this.state.appTitle} </h4>
        <span className="badge badge-secondary m-2">
          {this.state.customersCount}
        </span>
        <button className="btn btn-info" onClick={() => this.onRefreshClick()}>
          Refresh
        </button>
        <table className="table">
          <thead>
            <tr>
              <th>id</th>
              <th>Customer Name</th>
              <th>Phone</th>
              <th>City</th>
            </tr>
            <tbody>{this.getCustomerRow()}</tbody>
          </thead>
        </table>
        <div className="container">
          <CarTable cars={this.state.cars} users={this.state.users} />
        </div>
        {localStorage.accessLevel >= ACCESS_LEVEL_ADMIN ? (
          <div className="add-new-car">
            <Link className="blue-button" to={"/AddCar"}>
              Add New Car
            </Link>
            <Link className="header__link" to={"/ResetDatabase"}>
              <div className="header__option">
                <span className="header__optionLineOne"></span>
                <span className="blue-button">Reset Database</span>
              </div>
            </Link>{" "}
          </div>
        ) : null}

        <Footer />
      </div>
    );
  }
}

